import classes from "./Header.module.css";

const Header = () => {
  return (
    <div className={classes.div}>
      <p className={classes.p}>
        Hey Pretty Sarah, Its Almost Your Quarter Century On Earth
      </p>
    </div>
  );
};

export default Header;
